/***
 * This file is an adaptation of a demo from the JointJS library.
 * The original demo can be found at https://resources.jointjs.com/demos/logic
 */

import { Box, Button, Tooltip } from '@mui/material';
import * as joint from 'jointjs';
import { useCallback, useEffect, useRef } from 'react';
import Gates from './Gates.js';
import './linkView.css';
import './circuit.css';
import { useDimensions } from '../../util/useDimensionsHook.js';
import { useTheme } from '@emotion/react';
import { DragDropContext, Draggable, Droppable } from 'react-beautiful-dnd';
import { useTranslation } from 'react-i18next';

const gateSVG = {
    'And': 'url("data:image/svg+xml;base64,")',
    'Or': 'url("data:image/svg+xml;base64,")',
    'Not': 'url("data:image/svg+xml;base64,")',
    'Nand': 'url("data:image/svg+xml;base64,")',
    'Nor': 'url("data:image/svg+xml;base64,")',
    'Xor': 'url("data:image/svg+xml;base64,")',
    'Xnor': 'url("data:image/svg+xml;base64,")',
}

const shapes = {
    ...joint.shapes,
    logic: Gates
};

// ----------------- Helper functions -----------------

// Helper functions to place elements on the paper
const x = (x) => (x/100) * (700)
const y = (y) => (y/100) * (500)
// Add some randomness to the position to make the circuit look more natural
const fuzzyX = (inp) => x(inp + Math.random() * 10 - 5)
const fuzzyY = (inp) => y(inp + Math.random() * 10 - 5)


// ----------------- Main functional component -----------------
function CircuitViewer(props) {

    // Add translation
    const { t } = useTranslation()

    // Get Mui theme
    const theme = useTheme()

    // ----------------- Create the references -----------------

    // Create a reference to the paper element
    const paperRef = useRef(null)

    // Use references to store the paper and graph objects globally
    const paper = useRef(null)
    const graph = useRef(null)

    // Other variable refs
    const signalStrength = useRef(null)
    const dragPosition = useRef(null)

    // Checking ref
    const checking = useRef(null)
    checking.current = false

    // ----------------- Define signal propagation -----------------

    function toggleLive(model, signal) {
        // add 'live' class to the element if there is a positive signal
        model.findView(paper.current)?.vel.toggleClass('live', signal > 0);
    }

    function broadcastSignal(gate, signal) {
        // Set the signal on the gate
        gate.set('signal', signal > 0);

        // broadcast signal to all output ports
        setTimeout(function() {
            joint.util.invoke(graph.current.getConnectedLinks(gate, { outbound: true }), 'set', 'signal', signal);
        }, 0);
    }

    const initializeSignal = useCallback(() => {

        var strength = Math.random();
        // > 0 wire with a positive signal is alive
        // < 0 wire with a negative signal means, there is no signal
        // 0 none of the above - reset value
        signalStrength.current = strength;

        // cancel all signals stores in wires
        joint.util.invoke(graph.current.getLinks(), 'set', 'signal', 0);

        // remove all 'live' classes
        joint.V(paper.current.viewport).find('.live').forEach(function(vel) {
            vel.removeClass('live');
        });

        // set new signal strength in state

        graph.current.getElements().forEach(function(element) {
            // broadcast a new signal from every input in the graph
            if (element instanceof shapes.logic.Input) {
                broadcastSignal(element, signalStrength.current * (element.attributes.signal ? 1 : -1));
                toggleLive(element, element.attributes.signal ? 1 : -1);
            }
        });
    }, [])

    const updateSignal = useCallback(() => {
        // update the signals with the new inputs
        graph.current.getElements().forEach(function(element) {
            // broadcast a new signal from every input in the graph
            if (element instanceof shapes.logic.Input) {
                broadcastSignal(element, signalStrength.current * (element.attributes.signal ? 1 : -1));
                toggleLive(element, element.attributes.signal ? 1 : -1);
            }
        });
    }, [])

    // ----------------- Setup the graph -----------------

    const setupGraph = useCallback(() => {
        graph.current = new joint.dia.Graph({}, { cellNamespace: shapes });

        paper.current = new joint.dia.Paper({

            el: paperRef.current,
            model: graph.current,
            width: '100%',
            height: '100%',
            background: { color: theme.palette.background.graphicalView },
            gridSize: 5,
            snapLinks: true,
            linkPinning: false,
            cellViewNamespace: shapes,
            linkView: joint.dia.LinkView,
            defaultLink: props.fixed ? new shapes.logic.FixedWire() : new shapes.logic.FlexibleWire(),
            interactive: function(cellView) {
                // Only allow interaction with joint.dia.LinkView and Input instances.
                return !props.fixed || cellView.model.get('isModifiable')
            },

            validateConnection: function(vs, ms, vt, mt, e, vl) {
                if (props.fixed) return false

                if (e === 'target') {

                    // target requires an input port to connect
                    if (!mt || !mt.getAttribute('class') || mt.getAttribute('class').indexOf('input') < 0) return false;

                    // check whether the port is being already used
                    var portUsed = this.model.getLinks().some(function(link) {
                        return (link.id !== vl.model.id &&
                                link.get('target').id === vt.model.id &&
                                link.get('target').port === mt.getAttribute('port'));
                    });

                    return !portUsed;

                } else { // e === 'source'

                    // source requires an output port to connect
                    return ms && ms.getAttribute('class') && ms.getAttribute('class').indexOf('output') >= 0;
                }
            }
        });

        // ----------------- Signal propagation -----------------

        // Every logic gate needs to know how to handle a situation, when a signal comes to their ports.
        shapes.logic.Gate.prototype.onSignal = function(signal, handler) {
            handler(signal);
        };
        // The repeater delays a signal handling by 400ms
        shapes.logic.Repeater.prototype.onSignal = function(signal, handler) {
            setTimeout(function() {
                handler(signal);
            }, 400);
        };
        // Output element just marks itself as alive.
        shapes.logic.Output.prototype.onSignal = function(signal) {
            toggleLive(this, signal);
            this.set('signal', signal > 0);
        };

        // ----------------- Wire control -----------------
        graph.current.on('change:source change:target', function(model, end) {
            if (props.fixed) return

            var e = 'target' in model.changed ? 'target' : 'source';

            if ((model.previous(e).id && !model.get(e).id) || (!model.previous(e).id && model.get(e).id)) {
                // if source/target has been connected to a port or disconnected from a port reinitialize signals
                initializeSignal();
            }
        });

        graph.current.on('change:signal', function(wire, signal) {

            toggleLive(wire, signal);

            var magnitude = Math.abs(signal);

            // if a new signal has been generated stop transmitting the old one
            if (magnitude !== signalStrength.current) return;

            var gate = wire.getTargetElement();
            if (gate) {
 
                gate.onSignal(signal, function() {

                    // get an array of signals on all input ports
                    var inboundLinks = graph.current.getConnectedLinks(gate, { inbound: true });
                    // group the wires by the port they are connected to
                    var linksByPorts = joint.util.groupBy(inboundLinks, function(wire) {
                        return wire.get('target').port;
                    });
                    // get the signal values from the wires for each port
                    var inputs = joint.util.toArray(linksByPorts).map(function(wires) {
                        return Math.max.apply(this, joint.util.invoke(wires, 'get', 'signal')) > 0;
                    });
                    // calculate the output signal
                    var output = magnitude * (gate.operation.apply(gate, inputs) ? 1 : -1);

                    broadcastSignal(gate, output);
                });
            }
        });
    }, [initializeSignal, props.fixed, theme])

    // ----------------- Create the circuit -----------------

    const renderGraph = useCallback(() => {
        var gates = {}
        // Create inputs
        const numInputs = props.inputs.length
        props.inputs.forEach((input, index) => {
            gates[input.name] = new shapes.logic.Input({ 
                name: input.name,
                position: { x: 5, y: y(35 + (index-(numInputs-1)/2)*40/numInputs) }, 
                signal: true, 
                isModifiable: true 
            });
            gates[input.name]
                .attr('text', {text: input.label})
        })

        // Create gates
        let currLayer = 0
        let numLayers = props.gates.length
        props.gates.forEach(layer => {
            let numGates = layer.length
            layer.forEach((gate, index) => {
                let gateAttr = {
                    name: gate.name,
                    position: { 
                        x: fuzzyX(40 + (currLayer-(numLayers-1)/2)*(60/numLayers)), 
                        y: fuzzyY(35 + (index-(numGates-1)/2)*70/numGates) 
                    }, 
                    isModifiable: true,
                }
                switch (gate.type.toLowerCase()) {
                    case 'and':
                        gates[gate.name] = new shapes.logic.And(gateAttr);
                        break;
                    case 'or':
                        gates[gate.name] = new shapes.logic.Or(gateAttr);
                        break;
                    case 'not':
                        gates[gate.name] = new shapes.logic.Not(gateAttr);
                        break;
                    case 'nand':
                        gates[gate.name] = new shapes.logic.Nand(gateAttr);
                        break;
                    case 'nor':
                        gates[gate.name] = new shapes.logic.Nor(gateAttr);
                        break;
                    case 'xor':
                        gates[gate.name] = new shapes.logic.Xor(gateAttr);
                        break;
                    case 'xnor':
                        gates[gate.name] = new shapes.logic.Xnor(gateAttr);
                        break;
                    default:
                        break;
                }
            })
            currLayer++
        })
    
        // Create outputs
        const numOutputs = props.outputs.length
        props.outputs.forEach((output, index) => {
            gates[output.name] = new shapes.logic.Output({ 
                name: output.name,
                position: { x: x(85), y: y(35 + (index-(numOutputs-1)/2)*70/numOutputs) }, 
                signal: true, 
                isModifiable: true 
            });
            gates[output.name]
                .attr('text', {text: output.label})
        })
    
        // Define wires between gates
        var wires = []
        props.gates.forEach(layer => {
            layer.forEach(gate =>{
                gate.inputs.forEach((input, index) => {
                    wires.push({ 
                        source: { id: gates[input].id, port: 'out' }, 
                        target: { id: gates[gate.name].id, port: `in${gate.inputs.length > 1 ? index+1 : ''}` }, 
                        isModifiable: true 
                    })
                })
            })
        })

        // Define wires to outputs
        props.outputs.forEach(output => {
            wires.push({ 
                source: { id: gates[output.input].id, port: 'out' }, 
                target: { id: gates[output.name].id, port: 'in' }, 
                isModifiable: true 
            })
        })

        // Add gates and wires to the graph
        graph.current.addCells(joint.util.toArray(gates));
        joint.util.forIn(wires, function(attributes) {
            graph.current.addCell(paper.current.getDefaultLink().set(attributes));
        });
    }, [props.gates, props.inputs, props.outputs])

    const renderIO = useCallback(() => {
        var gates = {}
        // Create inputs
        const numInputs = props.inputs.length
        props.inputs.forEach((input, index) => {
            gates[input.name] = new shapes.logic.Input({ 
                name: input.name,
                position: { x: 5, y: y(35 + (index-(numInputs-1)/2)*40/numInputs) }, 
                signal: true, 
                isModifiable: true 
            });
            gates[input.name]
                .attr('text', {text: input.label})
        })
    
        // Create outputs
        const numOutputs = props.outputs.length
        props.outputs.forEach((output, index) => {
            gates[output.name] = new shapes.logic.Output({ 
                name: output.name,
                position: { x: x(85), y: y(35 + (index-(numOutputs-1)/2)*70/numOutputs) }, 
                signal: true, 
                isModifiable: true 
            });
            gates[output.name]
                .attr('text', {text: output.label})
        })

        // Add gates and wires to the graph
        graph.current.addCells(joint.util.toArray(gates));
    }, [props.inputs, props.outputs])

    // ----------------- Stencil functionality -----------------

    const mouseLocationRef = useRef({x:0,y:0});

    const logMousePosition = e => {
      // these are the cordinates of your current pointer position
      mouseLocationRef.current.x=e.clientX;
      mouseLocationRef.current.y=e.clientY;
    }

    // Add a listener to keep track of the mouse position
    useEffect(() => {
        document.addEventListener('mousemove', logMousePosition);
        return () => {
            document.removeEventListener('mousemove', logMousePosition);
        }
    }, [])

    function handleDragEnd(result) {
        const { destination } = result
        // Remove the item if dropped outside of the answer
        if (!destination) {
            return
        }

        // Remove error if the answer is changed
        if (destination.droppableId === "circuit") {
            let gate = result.draggableId.split('-')[0]
            addGateToCircuit(gate)
        }
    }

    function addGateToCircuit(gate) {
        let paperPoint = paper.current.clientToLocalPoint(mouseLocationRef.current.x, mouseLocationRef.current.y);
        let newGate = new shapes.logic[gate]({ name: gate, position: { x: paperPoint.x, y: paperPoint.y }, isModifiable: true });
        graph.current.addCell(newGate);
    }

    // ----------------- Circuit updating -----------------
    
    // First render of the circuit
    useEffect(() => {
        setupGraph()
        if (props.fixed) {
            renderGraph()
        } else {
            renderIO()
        }
        centerCircuit()
        initializeSignal()
    }, [paperRef, initializeSignal, props.fixed, renderGraph, renderIO, setupGraph])

    // Resize the circuit when the window is resized
    const dimensions = useDimensions(paperRef)
    useEffect(() => {
        if (paper.current) {
            centerCircuit()
        }
    }, [dimensions])

    // ----------------- Circuit submission -----------------

    function sleep(ms) {
        return new Promise(resolve => setTimeout(resolve, ms));
    }

    const checkCircuit = useCallback(async (sendSubmission=false) => {
        // TODO lock circuit while checking
        paper.current.setInteractivity(false)
        checking.current = true

        // Check the circuit by simulating all possible inputs
        let answer = []
        let inputs = graph.current.getElements().filter(element => element instanceof shapes.logic.Input)
        for (let i = 0; i < 2**inputs.length; i++) {
            let inputSignals = inputs.map((input) => { return {name: input.get('name'), signal: false} })
            inputs.forEach((input, index) => {
                inputSignals[index].signal = (i & (1 << (inputs.length-1 - index))) > 0
                input.set('signal', inputSignals[index].signal)
            })

            initializeSignal()

            // Wait for the signal to propagate and to have a nice animation
            await sleep(1000)
            
            // Get the answer from the output layer
            let answerLayer = inputSignals
            let outputSignals = graph.current.getElements()
                .filter(element => element instanceof shapes.logic.Output)
                .map(output => { return {name: output.get('name'), signal: output.get('signal')} })
            answerLayer = answerLayer.concat(outputSignals)

            answer.push(answerLayer)
        }

        // Enable interactivity again
        paper.current.setInteractivity(true)
        checking.current = false

        // Send submission to parent
        if (sendSubmission) props.setSubmission(answer)
    }, [initializeSignal, props])

    useEffect(() => {
        if (props.setSubmission && props.checkCircuit) {
            checkCircuit(true)
        }
    }, [checkCircuit, props.checkCircuit, props.setSubmission])

    useEffect(() => {
        if (props.error) {
            graph.current.getElements()
                .filter(element => element instanceof shapes.logic.Input)
                .forEach(input => { 
                    // Highlight the incorrect input
                    props.error.forEach(error => {
                        if (input.get('name') === error.name) {
                            input.set('signal', error.signal)
                        }
                    })
                })
            initializeSignal()
        }
    }, [props.error, initializeSignal])

    // ----------------- Circuit manipulation -----------------

    // Center the circuit on the paper
    function centerCircuit() {
        paper.current.transformToFitContent({ verticalAlign: 'middle', padding: 20 })
    }

    // Reset the circuit to its initial state
    function resetCircuit() {
        graph.current.clear()
        renderIO()
        centerCircuit()
        initializeSignal()
    } 
    
    // ----------------- User interaction -----------------

    // Set all event listeners once at the start
    useEffect(() => {
        // Toggle the signal on an input element when clicked
        paper.current.on('element:pointerclick', function(cellView) {
            if (cellView.model.attributes.type === 'logic.Input' && !checking.current) {
                var signal = cellView.model.get('signal');
                cellView.model.set('signal', !signal);
                updateSignal();
            }
        });

        // Remove a gate when double clicked
        paper.current.on('element:pointerdblclick', function(cellView) {
            if ((cellView.model instanceof shapes.logic.Gate11 || cellView.model instanceof shapes.logic.Gate21) && !checking.current) {
                cellView.model.remove();
                updateSignal();
            }
        });

        // Pan when draging the paper
        paper.current.on('blank:pointerdown', function(event, x, y) {
            // Store the clicked position with scaling
            var scale = paper.current.scale();
            dragPosition.current = { x: x * scale.sx, y: y * scale.sy };
        });

        // Stop panning on pointerup
        paper.current.on('cell:pointerup blank:pointerup', function(cellView, x, y) {
            dragPosition.current = null;
        });

        const handleMouseMove = function(event) {
            // Pan if dragging
            if (dragPosition.current) {
                paper.current.translate(
                    event.offsetX - dragPosition.current.x, 
                    event.offsetY - dragPosition.current.y
                );
            }
        }

        // Pan the paper
        paper.current.el.addEventListener('mousemove', handleMouseMove);

        // Zoom when using the mouse wheel
        paper.current.on('blank:mousewheel', function(evt, x, y, delta) {
            evt.preventDefault();

            const oldScale = paper.current.scale().sx;
            const newScale = oldScale + delta * .1;
    
            scaleToPoint(newScale, x, y);
        });

        // Clean up event listeners when the component is unmounted
        return () => {
            paper.current.off('element:pointerclick');
            paper.current.off('element:pointerdblclick');
            paper.current.off('blank:pointerdown');
            paper.current.off('cell:pointerup blank:pointerup');
            paper.current.el.removeEventListener('mousemove', handleMouseMove);
            paper.current.off('blank:mousewheel');
        }
    }, [updateSignal]);    

    // Function to zoom on mouse position
    const scaleToPoint = (nextScale, x, y) => {
        // Limit the scale to a certain range
        const MIN_SCALE = .5;
        const MAX_SCALE = 2;
        if (nextScale >= MIN_SCALE && nextScale <= MAX_SCALE) {
            // Calculate the translation needed to keep the point under the mouse in the same position
            const currentScale = paper.current.scale().sx;

            const beta = currentScale / nextScale;

            const ax = x - (x * beta);
            const ay = y - (y * beta);

            const translate = paper.current.translate();

            const nextTx = translate.tx - ax * nextScale;
            const nextTy = translate.ty - ay * nextScale;

            paper.current.translate(nextTx, nextTy);

            const ctm = paper.current.matrix();

            ctm.a = nextScale;
            ctm.d = nextScale;

            paper.current.matrix(ctm);
        }
    };

    // ----------------- Render the circuit -----------------

    return props.fixed ? 
        <Box ref={paperRef} /> 
    :    
        <DragDropContext onDragEnd={handleDragEnd}>
            <Droppable droppableId='circuit'>
                {(provided) => (
                    <Box 
                        ref={provided.innerRef} 
                        {...provided.droppableProps} 
                        sx={{ display: 'flex', width: '100%', flex: '1 1 auto' }} 
                    >
                        <Box ref={paperRef} />
                        {/* Place the provided.placeholder to get rid of the warning */}
                        <Box style={{ display: 'none' }}>{provided.placeholder}</Box>
                    </Box>
                )}
            </Droppable>
            <Box sx={{ display: 'flex', flexDirection: 'column', flex: '0 1 20%' }}>
                <GateStencil 
                    gates={Gates} 
                    availableGates={props.availableGates} 
                />
                <Box sx={{ display: 'flex', flexDirection: 'row', justifyContent: 'center', alignItems: 'center' }}>
                    <Tooltip title={t('level.check_circuit_tooltip')} arrow>
                        <Button variant='contained' sx={{ margin: 1 }} onClick={checkCircuit}>{t('level.check_circuit')}</Button>
                    </Tooltip>
                    <Tooltip title={t('level.center_circuit_tooltip')} arrow>
                        <Button variant='contained' sx={{ margin: 1 }} onClick={centerCircuit}>{t('level.center_circuit')}</Button>
                    </Tooltip>
                    <Tooltip title={t('level.reset_circuit_tooltip')} arrow>
                        <Button variant='contained' sx={{ margin: 1 }} onClick={resetCircuit}>{t('level.reset_circuit')}</Button>
                    </Tooltip>
                </Box>
            </Box>
        </DragDropContext>
}

const GateStencil = (props) => {
    let gateStencils = props.availableGates.map((gate, index) => 
        <Droppable key={`key-${gate}-${index}`} droppableId={`stencil-${gate}-${index}`} isDropDisabled>
            {(provided) => (
                <Box ref={provided.innerRef} {...provided.droppableProps} >
                    <Draggable draggableId={`${gate}-${index}`} index={0}>
                        {(provided, snapshot) => (
                            <>
                                <Box 
                                    ref={provided.innerRef} 
                                    {...provided.draggableProps} 
                                    {...provided.dragHandleProps}
                                    style={ snapshot.isDropAnimating ? { ...provided.draggableProps.style, transitionDuration: '0.000000000000001s' } : provided.draggableProps.style }
                                >
                                    <Box sx={{ margin: 1, padding: 1, 
                                        width: (theme) => theme.spacing(10),
                                        height: (theme) => theme.spacing(6),
                                        background: `no-repeat center/100% ${gateSVG[gate]}`, 
                                    }} />
                                </Box>
                                {snapshot.isDragging && (
                                    <Box sx={{ margin: 1, padding: 1, 
                                        width: (theme) => theme.spacing(10),
                                        height: (theme) => theme.spacing(6),
                                        background: `no-repeat center/100% ${gateSVG[gate]}`, 
                                    }} />
                                )}
                            </>
                        )}
                    </Draggable>
                    {/* Place the provided.placeholder to get rid of the warning */}
                    <Box style={{ display: 'none' }}>{provided.placeholder}</Box>
                </Box>
            )}
        </Droppable>
    )
    
    return <Box sx={{ display: 'flex', flexDirection: 'row', flexWrap: 'wrap', justifyContent: 'center', alignItems: 'center' }}>
        {gateStencils}
    </Box>
}

export default CircuitViewer